//SPDX-License-Identifier: MIT

pragma solidity >=0.6.0 <0.9.0;
contract SimpleStorage {
    uint w;//auto initialized to 0
    uint256 public fuInt= 25;
   /* int fInt=-4;
    bool fBool = true;
    string fString = 'String';
    address fAddress= 0xFB506Aeb89BDa385fD02B0cfb3f10b5B619d8302;*/
    function store(uint name) public{
        fuInt= name;
    }
    function retrieve() public view returns(uint256){
        return fuInt;
    }
    // function calc(uint) public pure{
    //      fuInt+fuInt;
    // }
    struct people{
        uint256 num;
        string name;
    }
    people public person1=people({num:97,name:"G"});
    people[] public People;
    mapping(string => uint256) public nameToNumber;
    function addpersons(string memory name,uint256 num) public{
        People.push(people({num:num,name:name}));
        nameToNumber[name]=num;
    }
}

